    return (
        <div className="landingpage">
            <Navbar/>
            <div >
                <div>
               
                <img src={bann2} alt="Banner image" />

                    <div className="BannerText">
                       <h1>A world of learning from ₹499</h1> 
                       <p>Expand your horizons with learning that’s worldwide. 
                        <br></br>Save now through March 20.</p>
                    </div>
                   <img src={bann2} alt="Banner image" />
                 </div>
                
                
            </div>
            <Footer/>
        </div>
    )
}
